import React from "react";
import PropTypes from "prop-types";
import Link from "next/link"; //링크 컴포넌트

const AppLayout = ({ children }) => {
  return (
    <div>
      <div>
        <Link href="/"></Link>
      </div>
      {children}
    </div>
  );
};

AppLayout.propTypes = {
  children: PropTypes.node.isRequired,
};

export default AppLayout;
